import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Views from "./pages/view";


function App() {
  return (
    <div className="App">
      Hello!
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Views/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
